import { toDisplayString } from '../clock';
export class ArrInsOp {
    id;
    obj;
    ref;
    data;
    constructor(id, obj, ref, data) {
        this.id = id;
        this.obj = obj;
        this.ref = ref;
        this.data = data;
    }
    span() {
        return this.data.length;
    }
    name() {
        return 'arr_ins';
    }
    toString() {
        return `"${this.name()}" ${toDisplayString(this.id)}!${this.span()}, obj = ${toDisplayString(this.obj)} { ${toDisplayString(this.ref)} ‚Üê ${this.data.map(toDisplayString).join(', ')} }`;
    }
}
